import axios from "axios";
import { Component } from "react";

const url = "https://covid19.mathdro.id/api";

const fetchData = () => {
  return axios.get((url) => {}).then((res) => console.log(res));
};

const componentDidMount = () => {
  this.fetchData();
};

export default fetchData;
